import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom'; // Make sure to import BrowserRouter and Routes

import Header from './components/header/header';
import VerticalNav from './components/VerticalNav/VerticalNav';
import Profile from './components/Profile/Profile';
import Accueil from './pages/Accueil/Accueil'; // Make sure Accueil component is imported correctly

const App = () => {
  return (
    <Router>
      <Header />
      <VerticalNav />
      <Routes>
        <Route path="/" element={<Accueil />} />
        <Route path="/profile/:userId" element={<Profile />} />
        {/* Add other routes as needed */}
      </Routes>
    </Router>
  );
};

export default App;
